<script>var __DATABRICKS_NOTEBOOK_MODEL = {"version":"NotebookV1","origId":1989733262689090,"name":"Apache Spark on Databricks for Data Engineers (Scala)","language":"scala","commands":[{"version":"CommandV1","origId":1989733262689092,"guid":"da233f0e-80a4-47b2-8c79-8dfb859b4487","subtype":"command","commandType":"auto","position":1.0,"command":"%md \n# Apache Spark on Databricks for Data Engineers\n\n** Welcome to Databricks! **\n\nThis notebook intended to give a high level tour of some of the features that are available to users using Apache Spark and Databricks and to be the final step in your process to learn more about how to best use Apache Spark and Databricks together. We'll be walking you through several data sources, creating UDFs, and manipulating data all from the perspective of a data engineer. While this is not by any means exhaustive, by the end of this notebook you should be familiar with a lot of the topics and subjects that are available in Databricks. We'll be reading in some data from several sources including CSVs and raw text files. We'll then be warehousing that data in Redshift and in parquet format. \n\nFirst, it's worth defining Databricks. Databricks is a managed platform for running Apache Spark - that means that you do not have to learn complex cluster management concepts nor perform tedious maintenance tasks to take advantage of Apache Spark. Databricks also provides a host of features to help its users be more productive with Spark. It���s a point and click platform for those that prefer a user interface like data scientists or data analysts. This UI is accompanied by a sophisticated API for those that want to automate jobs and aspects of their data workloads. To meet the needs of enterprises, Databricks also includes features such as role-based access control and other intelligent optimizations that not only improve usability for users but also reduce costs and complexity for administrators.\n\nIt's worth stressing that many tools don't make it easy to prototype easily, then scale up to production workloads easily without heavy work by the operations teams. Databricks greatly simplifies these challenges by making it easy to prototype, schedule, and scale elastically all in the same environment.\n\n\n** The Gentle Introduction Series **\n\nThis notebook is a part of a series of notebooks aimed to get you up to speed with the basics of Spark quickly. This notebook is best suited for those that have very little or no experience with Apache Spark. The series also serves as a strong review for those that have some experience with Spark but aren't as familiar with some of the more sophisticated tools like UDF creation and machine learning pipelines. The other notebooks in this series are:\n\n- [A Gentle Introduction to Apache Spark on Databricks](https://databricks-prod-cloudfront.cloud.databricks.com/public/4027ec902e239c93eaaa8714f173bcfc/346304/2168141618055043/484361/latest.html)\n- [Apache Spark on Databricks for Data Scientists](https://databricks-prod-cloudfront.cloud.databricks.com/public/4027ec902e239c93eaaa8714f173bcfc/346304/2168141618055194/484361/latest.html)\n- [Apache Spark on Databricks for Data Engineers](https://databricks-prod-cloudfront.cloud.databricks.com/public/4027ec902e239c93eaaa8714f173bcfc/346304/2168141618055109/484361/latest.html)\n\n## Tutorial Overview\n\nIn this tutorial, we're going to play around with data source API in Apache Spark. This is going to require us to read and write using a variety of different data sources. We'll hop between different languages and different APIs to show you how to get the most out of Spark as a data engineer.","commandVersion":0,"state":"finished","results":null,"errorSummary":"One of the commands could not be parsed","error":null,"workflows":[],"startTime":1.465098250529E12,"submitTime":1.465098250529E12,"finishTime":1.46509825053E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto" class=\"ansiout\"></div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1.465098261376E12,"submitTime":1.465098250633E12,"finishTime":1.465098261587E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"9c52c98e-516d-4f2a-bdf0-9b1edadb4b50"},{"version":"CommandV1","origId":1989733262689097,"guid":"20b4dea7-eff2-4888-915d-a3fb8525ad95","subtype":"command","commandType":"auto","position":1.52734375,"command":"%md \nYou'll see that we have a variety of other example datasets that you can access and play with. While you can simply list and checkout the datasets via the command line or via `%fs ls` it's often easier to just look at [the documentation.](https://docs.cloud.databricks.com/docs/latest/databricks_guide/index.html#03%20Accessing%20Data/5%20Public%20Example%20Data%20Sets/1%20DBFS%20Hosted%20Datasets.html)\n\nNow that we've touched on Databricks datasets, let's go ahead and get started with the actual log data that we'll be using. This brings us to a unique advantage of Databricks and how easy it is to use multiple languages in the same notebook. For example, a colleague at Databricks had already written an Apache log parser that works quite well in python, rather than writing my own, I'm able to reuse that code very easily by just prefacing my cell with `%python` and copying and pasting the code. Currently this notebook has Scala cells by default as we'll see below.","commandVersion":0,"state":"finished","results":null,"errorSummary":"One of the commands could not be parsed","error":null,"workflows":[],"startTime":1.465098250667E12,"submitTime":1.465098250667E12,"finishTime":1.4650982507E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"372f2050-c6ca-4c92-bd66-b6240ed5f9e0"},{"version":"CommandV1","origId":1989733262689098,"guid":"fe241b21-ea50-4251-8fb1-fa76a68a3c50","subtype":"command","commandType":"auto","position":1.6796875,"command":"%python \n\nimport re\nfrom pyspark.sql import Row\nAPACHE_ACCESS_LOG_PATTERN = '^(\\S+) (\\S+) (\\S+) \\[([\\w:/]+\\s[+\\-]\\d{4})\\] \"(\\S+) (\\S+) (\\S+)\" (\\d{3}) (\\d+)'\n\n# Returns a dictionary containing the parts of the Apache Access Log.\ndef parse_apache_log_line(logline):\n    match = re.search(APACHE_ACCESS_LOG_PATTERN, logline)\n    if match is None:\n        # Optionally, you can change this to just ignore if each line of data is not critical.\n        # For this example, we want to ensure that the format is consistent.\n        raise Exception(\"Invalid logline: %s\" % logline)\n    return Row(\n        ipAddress    = match.group(1),\n        clientIdentd = match.group(2),\n        userId       = match.group(3),\n        dateTime     = match.group(4),\n        method       = match.group(5),\n        endpoint     = match.group(6),\n        protocol     = match.group(7),\n        responseCode = int(match.group(8)),\n        contentSize  = long(match.group(9)))","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\"></div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":"One of the commands could not be parsed","error":null,"workflows":[],"startTime":1.465098261608E12,"submitTime":1.465098250701E12,"finishTime":1.46509826163E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"d2ca3177-f570-45e5-b9b5-08eae561be73"},{"version":"CommandV1","origId":1989733262689099,"guid":"7167a96a-9fdc-4fb1-be65-41c4009a2347","subtype":"command","commandType":"auto","position":1.83203125,"command":"%md \nNow that I've defined that function, I can use it to convert my unstructured rows of data into something that is a lot more structured (like a table). I'll do that by reading in the log file as an RDD. RDD's (Resilient Distributed Datasets) are the lowest level abstraction made available to users in Databricks. In general, the best tools for users of Apache Spark are DataFrames and Datasets as they provide significant optimizations for many types of operations. However it's worth introducing the concept of an RDD. As the name suggests, these are distributed datasets that are sitting at some location and specify a logical set of steps in order to compute some end result.\n\nAs we had covered in the first notebook in this series, Spark is lazily evaluated. That means that even though we've specified that we want to read in a piece of data it won't be read in until we perform an action. If you're forgetting these details, please review [the first notebook in this series](https://databricks-prod-cloudfront.cloud.databricks.com/public/4027ec902e239c93eaaa8714f173bcfc/346304/2168141618055043/484361/latest.html).","commandVersion":0,"state":"finished","results":null,"errorSummary":"One of the commands could not be pa ideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"727053d7-0236-4cf3-b3cf-ec98d0d52a0c"},{"version":"CommandV1","origId":1989733262689103,"guid":"ddbd9154-4393-4c46-a8ac-62cb959f6e98","subtype":"command","commandType":"auto","position":2.051025390625,"command":"%md This shows us that we've got a total of 100,000 records. But we've still got to parse them. To do that we'll use a map function which will apply that function to each record on the dataset. Now naturally this can happen in a distributed fashion across the cluster. This cluster is made up of executors that will execute computation when they are asked to do so by the primary master node or driver.\n\nThe diagram below shows an example Spark cluster, basically there exists a Driver node that communicates with executor nodes. Each of these executor nodes have slots which are logically like execution cores. \n\n![spark-architecture](http://training.databricks.com/databricks_guide/gentle_introduction/videoss_logo.png)\n\nThe Driver sends Tasks to the empty slots on the Executors when work has to be done:\n\n![spark-architecture](http://training.databricks.com/databricks_guide/gentle_introduction/spark_cluster_tasks.png)\n\nNote: *In the case of the Community Edition there is no Worker, and the Master, not shown in the figure, executes the entire code.*\n\n![spark-architecture](http://training.databricks.com/databricks_guide/gentle_introduction/notebook_microcluster.png)\n\nYou can view the details of your Apache Spark application in the Apache Spark web UI.  The web UI is accessible in Databricks by going to \"Clusters\" and then clicking on the \"View Spark UI\" link for your cluster, it is also available by clicking at the top left of this notebook where you would select the cluster to attach this notebook to. In this option will be a link to the Apache Spark Web UI.\n\nAt a high level, every Apache Spark application consists of a driver program that launches various parallel operations on executor Java Virtual Machines (JVMs) running either in a cluster or locally on the same machine. In Databricks, the notebook interface is the driver program.  This driver program contains the main loop for the program and creates distributed datasets on the cluster, then applies operations (transformations & actions) to those datasets.\n\nDriver programs access Apache Spark through a `SparkSession` object regardless of deployment location.\n\nLet's go ahead and perform a transformation by parsing the log files.","commandVersion":0,"state":"finished","results":null,"errorSummary":"One of the commands could not be parsed","error":null,"workflows":[],"startTime":1.465098250871E12,"submitTime":1.465098250871E12,"finishTime":1.465098250904E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"b7d907ce-7cc9-470e-95c8-be46520ae585"},{"version":"CommandV1","origId":1989733262689104,"guid":"21784502-228c-4fd6-914e-932bc914019d","subtype":"command","commandType":"auto","position":2.060546875,"command":"%python\nparsed_log_files = raw_log_files.map(parse_apache_log_line)","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\"></div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":"One of the commands could not be parsed","error":null,"workflows":[],"startTime":1.465098264344E12,"submitTime":1.465098250904E12,"finishTime":1.465098264361E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"f9837d48-9bfe-4f5b-ad06-c139062ec0ab"},{"version":"CommandV1","origId":1989733262689105,"guid":"ff53e742-0d52-4292-a163-eae7ecb1f543","subtype":"command","commandType":"auto","position":2.0986328125,"command":"%md\nPlease note again that no computation has been started, we've only created a logical execution plan that has not been realized yet. In Apache Spark terminology we're specifying a **transformation**. By specifying transformations and not performing them right away, this allows Spark to do a lot of optimizations under the hood most relevantly, pipelining. Pipelining means that Spark will perform as much computation as it can in memory and in one stage as opposed to spilling to disk after each step.\n\nNow that we've set up the transformation for parsing this raw text file, we want to make it available in a more structured format. We'll do this by creating a DataFrame (using `toDF()`) and then a table (using `registerTempTable()`). This will give us the added advantage of working with the same dataset in multiple languages.","commandVersion":0,"state":"finished","results":null,"errorSummary":"One of the commands could not be parsed","error":null,"workflows":[],"startTime":1.46509825094E12,"submitTime":1.46509825094E12,"finishTime":1.465098250974E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":fal our to mount all of those buckets, but let's go ahead and review what where we were before and why we took that detour. We had a DataFrame of data that we were hoping to be able to put into our data warehouse. We wanted to store that data in two distinct locations. One set of data should be in Redshift for our analysts to be able to access and the other set of data should reside in Amazon S3. We had to prep some credentials in order to be able to use those services and showed how we can do that with the `%run` command to run other notebooks in our environment.\n\nNow let's go ahead and write our data using Spark Redshift! This is actually going to be very simple and will seem very similar to reading in a CSV file. That's because as previously mentioned, Apache Spark has a variety of data source connectors that all use the same API format. A key difference is that Spark Redshift uses a temp directory (that is an S3 bucket directory) in order to load the directory. You should set an object lifecycle on the S3 bucket or that directory in order to delete those temp files after the data has been loaded. The details for how to do that are available on the [Spark-Redshift github repository](https://github.com/databricks/spark-redshift).","commandVersion":0,"state":"finished","results":null,"errorSummary":"One of the commands could not be parsed","error":null,"workflows":[],"startTime":1.465098252638E12,"submitTime":1.465098252638E12,"finishTime":1.465098252651E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"abd071d0-099a-4367-98b5-bca73375ec23"},{"version":"Comman
